export const SearchView = (props) => {
  let options = [<option value={props.data[0]}>{props.data[0]}</option>, <option value={props.data[1]}>{props.data[1]}</option>]
  return (
    <div>
    <input list="users" name="userSearch"/>
    <datalist id="users">
    {options}
    </datalist>
    </div>
  )
}
